pragma solidity > 0.8.0 < 0.9.0;

contract GlobaLStorage {

    enum StatusProject {Not, Completed, Sleep, Active}
    enum StatusAddress {Not, Block, ForTeacher, ForStudent, ForAdmin, Teacher, Student, Admin}
    
    struct Student {
        string login;
        string FIO;
        string classLetter;
        string email;
        string[] strongSides;
        uint8 class;
        bytes32 pass;
    }

    struct Teacher {
        string login;
        string FIO;
        string email;  
        uint numDepartment; // выбирается из глобального массива departments (все главы кафедр будут по умолчанию занесены в систему
        uint16[] numSchoolSubjects; // те предметы, которы е ведёт учитель (выбираются из глобального массива schoolSubjects)
        uint16[] numLaboratories; // выбираются из глобального массива laboratories
        bytes32 pass; 
        bool headTeacher;
        bool scientistManager;
    }

    struct Project {
        string name;
        string goal;
        address mentor;
        address[] members;
        uint16 numLaboratory; // выбирается из глобального массива laboratories
        uint16[] needKnowledge; // знания тех предметов, которые нужны участникам для работы над проектом (выбираются из глобального массива schoolSubjects)
        StatusProject status;
        mapping(address => string[]) tasksMembers;
        mapping(address => string) roleMembers;
    }

    struct Admin {
        string login;
        string FIO;
        bytes32 pass;
        bool headAdmin;
    }

    
    mapping (address => Student) students;
    mapping (address => Teacher) teachers;
    mapping (address => Admin) administrators;

    mapping (string => bool) usingEmails;
    mapping (address => StatusAddress) usingAddresses;
    mapping (string => address) usingLogins; // у каждого пользователя в системе должен быть уникальный логин

    mapping (address => uint[]) ownerProjects;

    Project[] projects;
    string[] public schoolSubjects;  // add
    string[] public laboratories;
    string[] public departments; // add

    constructor(address _logicContract) {

        // Кафедры:
        departments = ["Not", "MathAndInformatic"]; // add

        // Школьные предметы:
        schoolSubjects = ["", "Math", "Physics", "Computer Science", "Russian"]; // add

        // Лаборатории по умолчанию:
        laboratories = ["Not", "Electricity and magnetism", "Prototyping", "Mechanics and strength", "Thermal phenomena and molecular structures",
        "Microelectronics and circuit engineering", "Autonomous avionics", "Robotics", "Programming", "Mathematical modeling and analysis", "Astronomy and Aerospace Systems"];

        projects.push(); // У пользователей, не имеющих активного проекта, по умолчанию будет стоять значение 0 в поле activeProject

        // Первый ученик-администратор:
        students[0x5B38Da6a701c568545dCfcB03FcB875f56beddC4] = Student("Developer", "GP", "\xD0\x98", "", new string[](0), 0, keccak256(abi.encodePacked("Developer", "1"))); // использую кодировку utf-8
        administrators[0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2] = Admin("admin1", "GP", keccak256(abi.encodePacked("admin1", "1")), true);
        usingLogins["Developer"] = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;
        usingLogins["admin1"] = 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2;
        usingAddresses[0x5B38Da6a701c568545dCfcB03FcB875f56beddC4] = StatusAddress.Student;
        usingAddresses[0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2] = StatusAddress.Admin;

        // Второй ученик-администратор:
        students[0x4B20993Bc481177ec7E8f571ceCaE8A9e22C02db] = Student("ivan", "DM", "\xD0\x98", "", new string[](0), 0, keccak256(abi.encodePacked("ivan", "1")));
        administrators[0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB] = Admin("admin2", "DM", keccak256(abi.encodePacked("admin2", "1")), true); // сделать нормальный пароль
        usingLogins["ivan"] = 0x4B20993Bc481177ec7E8f571ceCaE8A9e22C02db; // изменить логин
        usingLogins["admin2"] = 0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB;
        usingAddresses[0x4B20993Bc481177ec7E8f571ceCaE8A9e22C02db] = StatusAddress.Student;
        usingAddresses[0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB] = StatusAddress.Admin;

        // занести глав кафедр и научных руководителей:
        teachers[0x617F2E2fD72FD9D5503197092aC168c91465E7f2] = Teacher("Scientist", "DS", "", 1, new uint16[](0), new uint16[](0), keccak256(abi.encodePacked("Scientist", "1")), true, true);
        teachers[0x617F2E2fD72FD9D5503197092aC168c91465E7f2].numLaboratories.push(3);
        Teacher storage t = teachers[0x617F2E2fD72FD9D5503197092aC168c91465E7f2];

        t.numSchoolSubjects.push(1);
        t.numSchoolSubjects.push(2);
        t.numLaboratories.push(3);
        t.numLaboratories.push(4);
        usingLogins["Scientist"] = 0x617F2E2fD72FD9D5503197092aC168c91465E7f2;
        usingAddresses[0x617F2E2fD72FD9D5503197092aC168c91465E7f2] = StatusAddress.Teacher;


        // Для Максета 
        // usingAddresses[0xA8368d91ce67D60b9e1288eB2ba2555C0e09EE94] = StatusAddress.ForStudent;
        // usingAddresses[0x486516Ce05a158cBD488F219Ca64Fea674b4b8f7] = StatusAddress.ForStudent;
        // usingAddresses[0x16496CAA734bA101cA1D931c648F9FA12856B69e] = StatusAddress.ForTeacher;
        // usingAddresses[0x52a0024cB03CCB7B787eba15A6f7FF7EF2fCE3f9] = StatusAddress.ForTeacher;
    }

}

